import React from 'react'
import styles from './Teamcard.module.css'
const Teamcard = (props) => {
  return (
    <div style={{backgroundImage:`url(${props.img})`}} className={styles.team_card_wrapper}>

      <div>{props.name}</div>
      <div>{props.role}</div>
    </div>
  )
}

export default Teamcard
